sys_variable_value.value:
(function execute(inputs, outputs) {
var utils = new EventUtils(inputs.event_id);
    var eventGR = utils.fetchEventDetailsByEventId();

    if (eventGR) {
        outputs.name = eventGR.event_name;
        outputs.date = eventGR.event_date;
        outputs.vip = eventGR.event_vip;
        outputs.status = eventGR.event_sta;
    } else {
        outputs.name = '';
        outputs.date = '';
        outputs.vip = false;
        outputs.status = '';
    }


})(inputs, outputs);

